import React, { Component } from "react";
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import "./style.css";

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
       isLoggedIn: false 
    }
  }

  render() {
    return <div className="App">Hello World</div>;
  }
}

export default App;
